needed to update the dar upload script btw, this is the part that was changed (previous one had some “data” field which is no longer supported:
```local grpc_upload_dar_request="{
    \"dars\": [
      {
        \"bytes\": \"${base64_encoded_dar}\",
        \"description\": \"${dar}\"
      }
    ],
    \"vet_all_packages\": true,
    \"synchronize_vetting\": true
  }"```
